Remember11 -the age of infinity-
Company: KID
Release date: Mar 18, 2004

Summary: Fuyukawa Kokoro, a third-year sociology major, boards a plane bound for Hokkaido to meet a research subject in the Specified Psychiatric Hospital for Isolation and Aegis, or SPHIA. For unknown reasons, her plane crashes in the mountains in the middle of a snowstorm. Of the 31 passengers, only she, Kusuda Yuni, Yomogi Seiji, and Mayuzumi Lin survive unharmed. Unable to establish communication with the outside world due to the fierce snowstorm, the four decide to take shelter in an empty cabin and wait until the storm passes.


